import React from "react";
import VQAForm from "./components/VQAForm";
import Navbar from "./components/Navbar";

function App() {
  return (
    <><Navbar /><div style={{ padding: "2rem" }}>
      <VQAForm />
    </div></>
  );
}

export default App;
